import React from 'react';

import classes from 'Categories.module.scss'

const Categories = () => {
  return (
    <div className={classes.Categories}>
      <ul>
        <li class="active">Все</li>
        <li>Мясные</li>
        <li>Вегетарианская</li>
        <li>Гриль</li>
        <li>Острые</li>
        <li>Закрытые</li>
      </ul>
    </div>
  );
};
export default Categories;
